import React from 'react'

export default function Footer() {
  return (
    <footer id="footer" className="fixed-bottom"  class="bg-body-tertiary text-center text-lg-start">

      <div class="text-center p-3" style="background-color: rgba(0, 0, 0, 0.05);">
        <p className="mt-3">&copy; 2024 MESTODLE</p>
      </div>

    </footer>
  )
}
